import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import Pokedex from "./components/pokedex/pokedex";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <span>HEader</span>
      </header>
      <Pokedex />
    </div>
  );
}

export default App;
